def cocktailsort(mass, comparison, exchange):
    for k in range(len(mass)-1, 0, -1):
        swapped = False
        for i in range(k, 0, -1):
            comparison += 1
            if mass[i]<mass[i-1]:
                mass[i], mass[i-1] = mass[i-1], mass[i]
                exchange += 1
                swapped = True

        for i in range(k):
            comparison += 1
            if mass[i] > mass[i+1]:
                mass[i], mass[i+1] = mass[i+1], mass[i]
                exchange += 1
                swapped = True
      
        if not swapped:
            return (('зміни'), exchange, ('зрівнення'), comparison, mass)


def heapsort(mass, comparison, exchange):
    def heapify(mass):
        start = (len(mass) - 2) // 2
        while start >= 0:
            siftDown(mass, start, len(mass) - 1)
            start -= 1

    def siftDown(mass, start, end):
        root = start
        while root * 2 + 1 <= end:
            nonlocal comparison
            comparison += 1
            child = root * 2 + 1
            if child + 1 <= end and mass[child] < mass[child + 1]:
                child += 1
            if child <= end and mass[root] < mass[child]:
                mass[root], mass[child] = mass[child], mass[root]
                nonlocal exchange
                exchange += 1
                root = child
            else:
                return

    heapify(mass)
    end = len(mass) - 1
    while end > 0:
        comparison += 1
        mass[end], mass[0] = mass[0], mass[end]
        exchange += 1
        siftDown(mass, 0, end - 1)
        end -= 1
    return(('зміни'),exchange, ('зрівнення'), comparison, mass)


def shell(mass, comparison, exchange):
    inc = len(mass) // 2
    while inc:
        for i, el in enumerate(mass):
            while i >= inc and mass[i - inc] > el:
                exchange += 1
                mass[i] = mass[i - inc]
                i -= inc
            mass[i] = el
            comparison += 1
        inc = 1 if inc == 2 else int(inc * 5.0 / 11)
    return (('зміни'), exchange, ('зрівнення'), comparison, mass)



